import logo from './logo.svg';
import './App.css';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container>
          <Row>
            <Col>1 of 1</Col>
          </Row>
        </Container>
      </header>
    </div>
  );
}

export default App;
